import React from 'react';
import SHOP_DATA from './ShopData.js';

class ShopPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      collections: SHOP_DATA,
    };
  }

  render() {
    return (
      <div>
        Shop Data
      </div>
    );
  }
}

export default ShopPage;
